import React from "react";





const NavbarItem =(props)=>{
    
    console.log()
    return(
        <div>
            {
                props.items.map((navBar)=>{
                    return(
                        <div>
                            <i className= {`fa ${navBar.icon}`}  aria-hidden="true"></i>
                            <p>{navBar.type}</p>
                        </div>
                    )
                   
                })
            }
            
            
        </div>
    )
  
};
export default NavbarItem;
